import base64
import json

raw_b64 = """""".strip()

# Cleanup potential spaces if user copied with them
raw_b64 = "".join(raw_b64.split())

try:
    decoded = base64.b64decode(raw_b64)
    print(f"Decoded length: {len(decoded)}")
    data = json.loads(decoded)
    print("JSON parsed successfully")
    pk = data.get('private_key', '')
    print(f"PK Length: {len(pk)}")
    print(f"PK Sample: {repr(pk[:50])}...{repr(pk[-50:])}")
    
    if "\\n" in pk:
        print("Found \\\\n in PK")
    if "\n" in pk:
        print("Found \\n (actual newline) in PK")
        
except Exception as e:
    print(f"Error: {e}")
